# Método de segmentación del mercado turístico
## usando datos masivos (big data) generados por los propios turistas
### Juan María Hernández Guerra, Christian González Martel
### 27 junio 2019

---






class: center, middle, inverse

# Objetivo

---
  
  

&lt;ru-blockquote&gt;A partir de datos generados por turistas en plataformas de viajes online, se aplican métodos de agrupamientos en redes para realizar estudios de segmentación de mercado útiles a la industria. 
&lt;/ru-blockquote&gt;
